import React from 'react';
import ChartBar from './ChartBar';
import './Chart.css';

const Chart = (props) => {

  const datapoints = [
    { label: 'january', value: 0 }
  ];

  return(
    <div className="chart">
      {props.datapoints?.map((datapoint) => {
        <ChartBar 
          key={datapoint.label}
          value={datapoint.value}
          maxValue={datapoint.maxValue}
          label={datapoint.label}
        />
      })}

      {map((datapoint) => {
        <ChartBar 
          key={datapoint.label}
          value={datapoint.value}
          maxValue={datapoint.maxValue}
          label={datapoint.label}
        />
      })}
    </div>
  )
}

export default Chart;
